import React from 'react'
import { Link } from 'react-router-dom';
import '../styles/Home.css';

const Join = () => {
  return (
    <>
      <h1>회원가입</h1>
      <input placeholder='이메일' />
      <button>로그인</button>
      <Link to="/pswordUpdate">비밀번호 재설정</Link>
      <Link to="/join">가입하기</Link>
    </>
  )
}

export default Join
